const vLedNames = [];
const vLedPositions = [];
export function SubdeviceController(){ return true; }
export function LacksOnBoardLeds() {return true;}
const DeviceMaxLedLimit = 240;
let ChannelRGBOrder = [];

const transactionID = 0x1f;


//Channel Name, Led Limit
const ChannelArray = [
	["Channel 1", 80],
	["Channel 2", 80], 
	["Channel 3", 80],
	["Channel 4", 80],
	["Channel 5", 80],
	["Channel 6", 80],
];

